import React, { useState, useEffect } from "react";



function Player(props){
const [playerInfo, setPlayerInfo] = useState({});
useEffect(() => {setPlayerInfo(props)}, 
    [props]);
console.log(playerInfo);
return (<div><p>Player {playerInfo.props.participantIndex + 1}: {props.summonerName}, K/D/A: {props.kills} / {props.deaths} / {props.assists}</p>
                <h1>Champion: {props.championName}</h1> <img src = {`http://ddragon.leagueoflegends.com/cdn/12.9.1/img/champion/${props.championName}.png`} alt = "Champion-Splash-Img"></img>
                <h3>Lane: {props.lane}</h3>
        </div>);
}

export default Player;
